import './App.css';


const TextInput = () => {

    return (
        <div className='TextInput'>

            <div className='Section'>
                <h2>:קו רוחב</h2>
                <input name='Latitude' className='InputBox' /> 
            </div>
            <div className='Section'>
                <h2>:קו אורך</h2>
                <input name='Longitude' className='InputBox' /> 
            </div>
        </div>

    );

}

export default TextInput;
